import styled from "@emotion/styled";

export const Container = styled.div`
  max-width: 360px;
  min-height: 60px;
`;
export const Logo = styled.img`
  width: 104px;
  height: 26px;
  margin-right: 2px;
`;

export const ButtonAnchor = styled.a`
width:100px
height: 34px`;
